import React from "react";
import { Text, View, Image } from "react-native";

export default function Login() {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Image
        style={{
          width: 250,
          height: 300,
          borderRadius: 10,
          marginBottom: 20,
        }}
        source={{
          uri: "https://images.unsplash.com/photo-1574436782441-05ef8ab77077?ixid=MnwxMjA3fDB8MHxzZWFyY2h8NDR8fGhlYWRwaG9uZXN8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60",
        }}
      />
      <Text style={{ color: "black", fontSize: 24 }}>Get Started</Text>
    </View>
  );
}
